import Calling from "../components/project_1/calling_back";


function Home(){
    return(
        <div>
          <Nav>
            <Nav.Link href={`/`}>Login</Nav.Link>
            <Nav.Link href={`/signup`}>Signup</Nav.Link>
          </Nav>
        </div>
    )
}

export default Home;
